import './App.css';
import {useEffect,useState} from 'react';
import axios from 'axios';

function App() {

  const [selectedFile,setSelectedFile]=useState(null);
  const [data,setData]=use
  
  const fileChangeHandler=(e)=>{
  setSelectedFile(e.target.files[0]);
  console.log(e.target.files[0]);
  }

  const handleSubmit=(e)=>{
    //eslint-disable-next-line
    const formData=new FormData();
    formData.append(
      "file",
      selectedFile,
      selectedFile.name
    );


    const requestOptions={
      method: 'POST',
      body: formData
    };

    fetch("http://127.0.0.1:8000/upload", requestOptions)
    .then(response=>response.json()
    .then(function(response){
      console.log(response)
    })
    )
  }

  const handleImage= async()=>{
    try{
      const response=await axios.get("http://localhost:8000/");
      console.log(response.data)
      setSelectedFile(response.data)
    }
    catch(e){console.log(e);}
    finally{}
  };
  useEffect(()=>{
    handleImage();
  },[]);

  return (
    <div className="App">
      <h1>Car Parking System</h1>
      <form>
        <fieldset>
          <input onChange={fileChangeHandler} name="image"  type="file"  accept='.jpeg,.png,.jpg' ></input>
        </fieldset>
        <button onClick={handleSubmit}>Upload</button> 
        <button onClick={handleImage}>Predict</button> </form>
        <div>
          {selectedFile?.message??null}
        </div>
    </div>
  );
}

export default App;
